// src/components/Checkout.js
import React from 'react';
import './Checkout.css';

function Checkout() {
  return (
    <div className="checkout">
      <h2 className="checkout__title">Checkout</h2>
      <p className="checkout__text">Complete your purchase here.</p>
    </div>
  );
}

export default Checkout;
